const handleDays = (value) => {
 if(value === 1) return `${value} day`;
 return `${value} days`;
}

const handleTrend = (value) => {
 if(value === 0) return `Same`;
 if(value > 0) return `+${value} days`
 return `${value} days`;
}

const handleProgress = (value) => {
	if(value < 0) return 100; 
	return 100 - Math.min(100, (value / 10) * 100);
}

const getColor = (value, opacity) => {
  if (value > 5) {
    return `rgba(244, 67, 54, ${opacity})`;
  }
  if (value > 0) {
    return `rgb(255, 160, 0, ${opacity})`;
  }
  return `rgb(67, 160, 71, ${opacity})`;
};

